import React, { userState } from "react"
import storeContext from "./storeContext";

const GlobalContext = (props) => {
    const [cart, setCart] = userState([]);

    return (
        <storeContext.Provider value={{
            cart: cart
        }}>
            {props.children}
        </storeContext.Provider>
    )
};

export default GlobalContext;
